import React from 'react'
// import data from './data.js'
import Joke from './joke'



function Content() {
    const data=[
        {id:1,
         quetion:"What is your name?",
         answer:"my name is keshav garg"
        },
        {id:2,
        quetion:"Where you are studying?",
        answer:"I am studing in NIT hamirpur"
        },
        {id:3,
        quetion:"What you are studying",
        answer:"I am studying B.tech in mechanical engineering"
        }
    ]
    const dataComponents = data.map(joke => <Joke key={data.id} quetion={data.quetion} answer={data.answer} />)
    const date = new Date
    const hours = date.getHours()

    const Style = {
        fontSize: 40
    }

    let timeofday
    if (hours < 12) {
        timeofday = 'Morning'
        Style.color = 'blue'
    }
    else if (hours < 17) {
        timeofday = 'Afternoon'
        Style.color = 'red'
    }
    else {
        timeofday = "Night"
        Style.color = 'green'
    }
    return (
        <div>
            <div>
                <h1 style={Style}>Good {timeofday}</h1>
            </div>
            <div>
                {dataComponents}
            </div>
        </div>
    )
}

export default Content
